import React, {useState} from 'react'
import {motion} from "framer-motion"

export default function Box3(){

    const boxVariant = {
        hidden:{x:"-100vw"},
        visible:{x:"0"}
    }
    
   
    return(
        <div className="box-container">
            <motion.div  
                className='box'
                variants={boxVariant}
                animate="visible"
            >
                {[1,2,3].map(box =>{
                    return <li className='boxItem'></li>
                })}

            </motion.div>

        </div>
    )
}
